class nic {

    public static $names=[];

	public static function getChance($chance) {
		return mt_rand(0, 999) < $chance * 10;
	}

	public static function randomName($real=true) {

        if($real) {

            if(empty(self::$names)) {
                $u=new Model_User();
                $names = $u->where('last_login', 'is not', null)
                    ->where('email', 'is not', null)
                    ->where('email', 'not like', '%forrroger%')
                    ->where('office_id', '=', 1)
                    ->where('parent_id', 'is', null)
                    ->limit(200)
                    ->order_by('last_login','desc')
                    ->find_all();

                foreach($names as $u) {
                    self::$names[]=$u->visible_name??$u->name;
                }
            }
            if(!empty(self::$names)) {
				return self::$names[array_rand(self::$names)];
			}
        }

