	public static function matchMap($num=6,$start=1,$max=100) {

		$res = array();
		$k = $start;
		$l = $k == 1 ? $num : $num+1;

		for($i=1;$i<=$max;$i++) {
			if($i<=$l*floor($max/$l)) {
				$res[$i] = $k;
				$k = $k<$num?$k+1:$start;
			}
			else {
				$res[$i] = -1;
			}
		}
		return $res;
	}
